import React from "react";
import { useNavigate } from "react-router-dom";

const Dashboard = () => {
  const navigate = useNavigate();

  return (
    <div className="min-h-screen bg-gray-100 flex flex-col items-center justify-center">
      <h1 className="text-3xl font-bold text-gray-700 mb-6">Welcome to Your Dashboard</h1>
      <div className="flex gap-4">
        <button className="bg-blue-500 hover:bg-blue-600 text-white py-2 px-6 rounded"
          onClick={() => navigate("/interview/self-intro")}>Start Interview</button>
        <button className="bg-red-500 hover:bg-red-600 text-white py-2 px-6 rounded"
          onClick={() => navigate("/login")}>Logout</button>
      </div>
    </div>
  );
};

export default Dashboard;
